/*Given a string, find the first non-repeating character in it and return it's index. If it doesn't exist, return -1.

Examples:

s = "leetcode"
return 0.

s = "loveleetcode",
return 2.
Note: You may assume the string contain only lowercase letters.*/

#include <stdio.h>
#include <stdlib.h>
#include <string.h>
#include <math.h>
#include <stdbool.h>

int firstUniqChar(char* s) {
	int counts[26]={0};
	int orders[26]={0};
	int indexs[26]={0};
	int order=0;
	int slen=strlen(s);
	for(int i=0;i<slen;i++){
		int index=*(s+i)-'a';
		counts[index]+=1;
		if(orders[index]==0) orders[index]=++order;
		if(indexs[index]==0) indexs[index]=i+1;
	}
	int ordertmp=0;
	int indexret=0;
	for(int j=0;j<26;j++){
		if(counts[j]!=1) continue;
		if(ordertmp==0&&indexret==0){
			ordertmp=orders[j];
			indexret=indexs[j];
		}else{
			if(orders[j]<ordertmp){
				ordertmp=orders[j];
				indexret=indexs[j];
			}
		}
	}
	return indexret-1;
}
int main(int argc, char const *argv[])
{
	char *s="";
	printf("%d\n", strlen(s));
	printf("%d\n", firstUniqChar(s));
	return 0;
}

